Go has a convention that the entry point of your application should be called main. e.g.: package main
... The main package has special significance. Mainly, that the main package should contain a main function. i.e. a function with the name of main. package main func main() { } If I run this package, the main function will execute. There's another special function called init. If you declare a function named init, it will execute when the package loads (before the main function). The init function is entirely optional. package main func init() { println("runs when the package loads and before main runs")
} func main() { println("runs when the package loads, but after init")
} Note that most packages don't have a main function. The main package should be kept small. Typically, you will be importing a different package and calling that code from within your main function.

